// src/components/AboutMe.jsx
import React from 'react';
import './AboutMe.css';

const AboutMe = () => {
  return (
    <section id="about" className="about-me">
      <h2>About Me</h2>
      <p>
        Hi, I'm Apurva Rajput, a passionate software engineer with 3+ years of experience
        in developing custom solutions. I specialize in Python, data manipulation, and workflow
        automation. I am always excited to work on innovative projects and improve business operations.
      </p>
    </section>
  );
}

export default AboutMe;
